from community import community_static


class layer_2_utility:
    def __init__(self, _building, _layer_1, _layer_2):
        self.layer_1 = _layer_1
        self.layer_2 = _layer_2
        self.building = _building
        
        
    def exctract(self):
        main_list = []
        for i in range(len(self.building)):  #item
            for ii in range(len(self.building[i][self.layer_1])):                     # friends
                main_list.extend(self.building[i][self.layer_1][ii][self.layer_2])                        # bubbles
        return main_list
       


class layer_dic_utility:
    def __init__(self, _building, _layer_0):
        self.layer_0 = _layer_0
        self.building = _building
        
    
    def add_cid(self,cid):
        ob = community_static()
        fetch = ob.community_card(cid)
        self.building[self.layer_0] = fetch
        return self.building    
    
class layer_0_utility:
    def __init__(self, _building):
        self.building = _building
    
    def remove_repeated(self):
        new_list = []
        for i in self.building:
            if i not in new_list:
                new_list.append(i)
        return new_list
    
    
        
class layer_1_utility:
    def __init__(self, _building, _layer_1):
        self.building = _building
        self.layer_1 = _layer_1
        
    def sorting(self):
        for n in range(len(self.building)):
            for nn in range(len(self.building) - 1):
                if(self.building[nn][self.layer_1] >= self.building[nn + 1][self.layer_1]):
                    temp = self.building[nn] #pos 1
                    self.building[nn] = self.building[nn + 1] #pos2
                    self.building[nn + 1] = temp #pos
        return self.building  
    
    
    def exctract(self):
        main_list = []
        for i in range(len(self.building)):  #item
            main_list.extend(self.building[i][self.layer_1])     # friends                    
        return main_list
        
   
    
    
    def remove_repeated(self):
        self.building.reverse()
        new_list = [i for n, i in enumerate(self.building) if i.get(self.layer_1) not in [y.get(self.layer_1) for y in self.building[n + 1:]]]
        return new_list
        
    def find_frequency(self):
        for i in range(len(self.building)):
            self.building[i]['freq'] = 0
            for ii in range(len(self.building)):
                if self.building[i][self.layer_1] == self.building[ii][self.layer_1] and i <= ii:
                    self.building[i]['freq'] += 1
        return self.building

     
